
"""
# Find the Winner of an Array Game

Given an integer array `arr` of **distinct** integers and an integer `k`.

A game will be played between the first two elements of the array (i.e. `arr[0]` and `arr[1]`). In each round of the game, we compare `arr[0]` with `arr[1]`, the larger integer wins and remains at position `0`, and the smaller integer moves to the end of the array. The game ends when an integer wins `k` consecutive rounds.

Return *the integer which will win the game*.

It is **guaranteed** that there will be a winner of the game.


**Example 1:** 
```
Input: arr = [2,1,3,5,4,6,7], k = 2
Output: 5
Explanation: Let's see the rounds of the game:
Round |       arr       | winner | win_count
  1   | [2,1,3,5,4,6,7] | 2      | 1
  2   | [2,3,5,4,6,7,1] | 3      | 1
  3   | [3,5,4,6,7,1,2] | 5      | 1
  4   | [5,4,6,7,1,2,3] | 5      | 2
So we can see that 4 rounds will be played and 5 is the winner because it wins 2 consecutive games.
```

**Example 2:** 
```
Input: arr = [3,2,1], k = 10
Output: 3
Explanation: 3 will win the first 10 rounds consecutively.
```

**Constraints:** 
    - `2 <= arr.length <= 10^5` 
    - `1 <= arr[i] <= 10^6` 
    - `arr` contains **distinct** integers.
    - `1 <= k <= 10^9` 
"""

import unittest
from typing import List

class Solution:
    def getWinner(self, arr: List[int], k: int) -> int:
        lo, hi, win_count = 0, 1, 0
        while hi < len(arr):
            if arr[lo] > arr[hi]:
                hi, win_count = hi + 1, win_count + 1
            else:
                lo, hi, win_count = hi, hi + 1, 1
            if win_count >= k:
                return arr[lo]
        return arr[lo]


class Test(unittest.TestCase):
    def setUp(self):
        self.soln_obj = Solution()

    def testcase1(self):
        self.assertEqual(self.soln_obj.getWinner([2, 1, 3, 5, 4, 6, 7], 2), 5)

    def testcase2(self):
        self.assertEqual(self.soln_obj.getWinner([3, 2, 1], 10), 3)

    def testcase3(self):
        self.assertEqual(self.soln_obj.getWinner([1, 11, 22, 33, 44, 55, 66, 77, 88, 99], 1000000000), 99)

    def testcase4(self):
        self.assertEqual(self.soln_obj.getWinner([1,25,35,42,68,70], 1), 25)

    def testcase5(self):
        self.assertEqual(self.soln_obj.getWinner([1, 25, 35, 42, 68, 70], 2), 70)

